//Program NWD
//Zajduje nwd z dwóch losowych
//liczb dodatnich

//W formie powiadomienia wypisuje:
// * Dwie liczby wejściowe,
// * Wynik


// Wygenerowanie
// dwóch liczb wejściowych
getA: IN 6
SOM getA
SOZ getA
LAD a
getB: IN 6
SOM getB
SOZ getB
LAD b


// Wypisanie
// liczb wejściowych
OUT 5
POB a
OUT 4
POB b
OUT 4

// Obliczanie NWD
//A > B
aMinusb: POB a                
aMinusB+1: ODE b
SOZ stop  
SOM bMinusA   
LAD a 
SOB aMinusB+1

//B>A
bMinusA: POB b
bMinusA+1: ODE a
SOZ stop
SOM aMinusb
LAD b
SOB bMinusA+1

// znaleziono NWD
// Wypisanie Wyniku
stop: DOD a
OUT 4
STP

a: RPA
b: RPA
